              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Rab Havlin was able to switch Al Rufaa off early doors as he can over-race but he came through well in the end. Ideally he would enjoy some more give in the ground - Thady Gosden, assistant trainer"
