          "comment": "7.5f winner last term; fair fourth at Beverley latest and looks to be coming back to form",
          "spotlight": "Chester winner off a pound lower last July (7.5f, good); mixed efforts since but fair fourth at Beverley last time (7.5f, good); looks to be coming back to form.",
