          "comment": "Exposed; won the Bell here in 2023 and third in it last year; conditions ideal; contender",
          "spotlight": "Exposed performer who won the Carlisle Bell at this meeting off 5lb higher in 2023 (1m, good to soft) and was third off this mark in that race last year; creditable third at Goodwood last time; well suited by 1m and soft ground; definite contender.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-06-28",
              "horse": "Mostawaa",
              "horse_id": "2292606",
              "race": "Stablemate By Agma Carlisle Bell Handicap",
              "race_id": "842097",
              "course": "Carlisle",
              "course_id": "crs_208",
              "distance_f": "8",
              "distance_y": "1713",
              "quote": "Mostawaa has turned a corner in his old age. He won at Brighton two starts ago and then he went to York and toughed it out. I got a very easy lead that day and things fell right whereas today there was plenty of pace on paper, so you just never know. He stuck to it well on soft ground and I think we can investigate going up to ten furlongs now. Between the three and the two I didn't get much of a breather into him and we were going a good gallop. Myself and Pierre were kind of taking each other on but to be fair they both fought on well - Hollie Doyle, jockey."
            },
            {
              "date": "2023-06-17",
              "horse": "Mostawaa",
              "horse_id": "2292606",
              "race": "Ice Co Supporting Macmillan Handicap",
              "race_id": "840924",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "9",
              "distance_y": "1937",
              "quote": "I was a bit worried because Mostawaa didn't have his headgear on today but he jumped well, settled, and got into a nice rhythm. The further he went the better, and he loved the ground - Hollie Doyle, jockey."
            }
          ],
