          "comment": "On last winning mark but no better than sixth across her five starts this season",
          "spotlight": "Won off this mark at Hamilton (1m4f, good to soft) last September but she's finished no better than sixth across her five starts this season and she has to raise her game.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-07-05",
              "horse": "Tafsir",
              "horse_id": "4409373",
              "race": "Racecourse Live Streams On Racing TV Extra Handicap",
              "race_id": "843052",
              "course": "Musselburgh",
              "course_id": "crs_416",
              "distance_f": "12.5",
              "distance_y": "2744",
              "quote": "Tafsir is a well-bred filly so it's good to get a win, but Paul's given her an absolute peach of a ride. He's gone down the brave man's route down the inside rail and has won quite comfortably in the end. She'll win again, especially with the assistance of Paul. He's top-class - Jim Goldie, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Tafsir",
              "horse_id": "4409373",
              "quote": "She's challenging but she always has been. It's always been onwards and upwards with her and she has her own way of doing things. She probably needs to race herself fit. She probably needs a couple of runs to get there. It could have been a blindfold issue on her penultimate start and she doesn't make it easy for the jockeys as she knows the rhythm of the stalls and she starts to mess about - she plays games. She couldn't make an impression behind Faylaq at Hamilton last time. She was probably the cheapest of Hamdan's cast-offs and it looked like they were right, but now she's won more races than most of them. He bred her to be better than 78, so we don't know if her mark is too high. 07-05-25"
            }
          ],
