          "comment": "On a reduced mark but has never run over a trip this short; couple of questions to answer",
          "spotlight": "On a reduced mark and he ran well when a close third at Newcastle (1m2f, AW) in March; however, soundly beaten at Lingfield (1m2f, AW) since and his last two wins (in 2023) came over 1m4f/1m2f; has never run over a trip this short and has a couple of questions to answer.",
