          "comment": "Dead-heated for first at Ripon in April and had an excuse at Newmarket subsequently",
          "spotlight": "Six wins between December 2023 and last June (including on soft/good to soft), and back on song when dead-heating for first at Ripon (1m, good) in April; hampered by loose horse when well beaten at Newmarket last time so that run can be excused; this prominent-racer may make a bold bid.",
