          "spotlight": "On a dangerous mark on last season's best form, such as when second in the Thirsk Hunt Cup (1m, good to soft) off 7lb higher; he may have needed his reappearance run at Doncaster in March but he also wasn't at his best on his final few outings last season; returns from another break.",
