          "comment": "Withdrawn when 28-1 for intended handicap debut; rather watch this second attempt",
          "spotlight": "Mixed form in three qualifying runs but he went very close over this trip at Lingfield on debut and his fifth here in April (1m2f) was a respectable effort behind some useful prospects; blotted his copybook when unruly at the start and refused to enter the stalls on intended handicap debut this month (28-1 at the time; Lazieelunch close second at 12-1); rather watch this second attempt; tongue-tie added.",
          "medical": [],
          "quotes": [],
          "stable_tour": [
            {
              "horse": "Padua",
              "horse_id": "6710705",
              "quote": "He nearly won first time out at Lingfield in November when sent off at 125-1, but then we ran him back a bit quickly afterwards. He ran a nice race on his seasonal return at Kempton in April behind Ernst Blofeld and we're now just waiting for the ground really. I've got rather too many three-year-olds rated in the high 70s who are still maidens - they've all been second and are very difficult to place in the current system. Ever since a novice system for three-year-olds came in it's been very difficult to place those who are in the 75-80 range. Normally you'd have won a maiden by then and been competitive in a handicap, but now they're novices you're taking on basically Group horses. If you come second or third that puts you up too high in the handicap and you're in the middle of nowhere. 29-05-25"
            }
          ],
