          "comment": "Lurks on a dangerous mark but in and out in 2025; fair effort at Windsor on Monday",
          "spotlight": "Front-runner who lurks on a dangerous mark; he's been in and out for a while now but this company should be more manageable for him and he ran creditably at Windsor on Monday.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-07-27",
              "horse": "Night On Earth",
              "horse_id": "3125461",
              "race": "Sky Bet \"Jump Jockeys' Nunthorpe\" Handicap (To Be Ridden By Professional Jump Jockeys)",
              "race_id": "871390",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "That was very different and a great thrill. It's a race I've wanted to ride in for the last two years but couldn't get a ride. You get a good start and then you let Night On Earth dictate, you're just a passenger. I felt the others coming to my girths but I always felt like I was digging out deep - Charlie Todd, jockey."
            },
            {
              "date": "2024-04-23",
              "horse": "Night On Earth",
              "horse_id": "3125461",
              "race": "Betfred Handicap",
              "race_id": "864365",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Night On Earth has got a lot of early pace and he put that to good use. He was drawn wide today and he's managed to get across early ? he really does have a lot of speed. We had worries about Epsom. We weren't too sure about how he'd manage it, but he's always struck us as a horse who might do well in the Dash and I think he coped with it better than we expected. Chester will be the next stop and then we'll hopefully come back for the Dash - Ian Williams, trainer."
            },
            {
              "date": "2020-07-13",
              "horse": "Night On Earth",
              "horse_id": "3125461",
              "race": "British EBF Novice Stakes (Plus 10 Race)",
              "race_id": "761071",
              "course": "Windsor",
              "course_id": "crs_2418",
              "distance_f": "5",
              "distance_y": "1121",
              "quote": "Night On Earth is another horse to look forward to. He's very relaxed at home so we started him over six but he's appreciated the drop back to five today and is clearly fast - Oisin Murphy, rider."
            }
          ],
          "stable_tour": [
            {
              "horse": "Night On Earth",
              "horse_id": "3125461",
              "quote": "He did not join us until the autumn but has done very well, winning three times, including his most recent race at Kempton earlier this month. He is pure speed and will stick to 5f. Having started off on 80 he is now up to 92. I hope he can do even better on the turf as he certainly looks the part and I think he is still on a very fair mark. 22-03-22"
            }
          ],
