          "comment": "Two wins in 7f events on good; 6f should be fine; an intriguing contender now handicapping",
          "spotlight": "Looked good when beating his 14 rivals at Thirsk on debut in April and defied a penalty at Newbury (again 7f on good) one month later; the Newbury second and third have won since; good prospect and the drop to sprinting shouldn't be an issue (dam won the Abbaye); an intriguing contender.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-16",
              "horse": "Montpellier",
              "horse_id": "7365383",
              "race": "Trade Nation Novice Stakes (GBB Race) (Div I)",
              "race_id": "892789",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "I was thrilled Montpellier showed natural progression from first run to second. He'd have learned plenty today. He had to fight a little bit, whereas first time he found it a lot easier. Carrying a penalty is no easy feat. He seemed to handle the ground no problem. It was riding on the quick side and he still showed a little bit of greenness, but overall I'm thrilled. He's definitely going to improve in time. His work at home has been pretty good, so I'm hopeful he can take another step forward - James Ferguson, trainer."
            }
          ],
