          "prev_owners": [],
          "comment": "Doncaster win in March and 2nd of 16 at York latest; should be in the thick of it",
          "spotlight": "Prominent racer; returned to action with a game 6f win at Doncaster in March; below par at the Craven meeting (blew the start) but back on track with a second of 16 at York's Dante meeting six weeks ago (6f, good to firm); nudged back up 1lb but still well handicapped on his 2024 best; another big effort seems likely.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-04-17",
              "horse": "Dark Thirty",
              "horse_id": "4175291",
              "race": "Weatherbys Global Stallions App Handicap",
              "race_id": "863372",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Dark Thirty was always going to be a nice horse this year mentally more than anything and he did that well. He could be a fun Saturday horse - Sean Levey, jockey."
            },
            {
              "date": "2023-08-26",
              "horse": "Dark Thirty",
              "horse_id": "4175291",
              "race": "Bet With JenningsBet Handicap",
              "race_id": "845964",
              "course": "Newmarket (July)",
              "course_id": "crs_4524",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Dark Thirty likes it here and that shower we had helped him. He's a consistent type - Sam Hitchcott, jockey."
            },
            {
              "date": "2023-05-17",
              "horse": "Dark Thirty",
              "horse_id": "4175291",
              "race": "Conundrum HR Consulting Handicap",
              "race_id": "838267",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "I was confident seven furlongs was going to be best for Dark Thirty. He was a bit of a handful last time at Newmarket over a mile but he settled better today. I was pleased as he stuck on really well - Sean Levey, jockey."
            },
            {
              "date": "2022-05-13",
              "horse": "Dark Thirty",
              "horse_id": "4175291",
              "race": "Starlight Isla And Bella Maiden Stakes (GBB Race) (IRE Incentive Race)",
              "race_id": "809984",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Dark Thirty only does enough, but I'm not surprised - he's a very nice horse. He works okay, like a lot of good ones, and this fella will be better when he goes further and he'll improve nicely for that. You have to think about Royal Ascot with any juvenile who wins at this time of year, but he's a very nice horse for the rest of the season and if that doesn't include Ascot, that's fine. That will switch him on a lot because he's not a zippy two-year-old; he's a grinder with a lovely attitude - Richard Hannon, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Dark Thirty",
              "horse_id": "4175291",
              "quote": "He goes well fresh and fought back to win at Doncaster first time out, which was pleasing. He got upset in the gates at Newmarket last week and missed the break, and Ryan [Moore] left him alone after that, so I'd say there's still plenty left to come from him if that was a one-off. 22-04-25"
            }
          ],
