              "course_id": "crs_962",
              "distance_f": "23.5",
              "distance_y": "5151",
              "quote": "I didn't really want to make the running. Watchoutitscookie has a tendency to go to his right, but as long as you don't fight him, he's pretty straightforward that way. So I made the running on him, he's jumped well, and he's done it well - Lorcan Murtagh, jockey, speaking to Sky Sports Racing."
