          "comment": "Did well to finish second at Market Rasen but he flopped at Warwick latest; mixed messages",
          "spotlight": "Dual Flat winner who is 0-8 over hurdles; got hampered at a crucial stage when a creditable second at Market Rasen (2m, good) last month but he flopped in similar conditions at Warwick 12 days later; still has potential in this sphere but he needs to bounce back after that last run.",
