          "comment": "Experienced 3yo stayed on to take Listed contest last time; step up in trip looks positive",
          "spotlight": "Experienced 3yo who finished just a neck behind Coronation Stakes winner Cercene when third in the Athasi Stakes last month (1m, good); a number of placed efforts at Group level; dropped in class and stayed on to win a Navan Listed contest last time; step up in trip here looks positive.",
